INSERT INTO `noticias` (`id`, `titulo`, `encabezado`, `descripcion`, `tipo`, `categoria`, `imagen`, `video`, `fuente`, `fecha`, `hora`, `mostrar`, `caduca`, `visualizaciones`, `audio`) VALUES
(1, 'Revocaron la suspensiÃ³n de las elecciones en Boca y se votarÃ¡ este domingo', 'La Justicia dejÃ³ sin efecto la medida cautelar presentada por la jueza Abrevaya a pedido de la oposiciÃ³n y el club quedÃ³ habilitado a realizar los comicios', 'La CÃ¡mara de Apelaciones revocÃ³ la medida cautelar que suspendiÃ³ las elecciones en Boca Juniors y el club quedÃ³ habilitado a celebrar los comicios este domingo 17 de diciembre. Mientras se aguarda el comunicado oficial del club, las autoridades xeneizes convocaron a una reuniÃ³n de ComisiÃ³n Directiva donde se fijarÃ¡ la nueva fecha de los comicios.', '5', '30', '6727.jpg', '', '', '2023-12-11', '20:43:14', '1', NULL, '1', ''),
(2, 'MaÃ±ana seguirÃ¡n las restricciones para operar con dÃ³lares y se esperan los anuncios de Caputo luego del cierre de los mercados', 'El Banco Central ordenÃ³ hoy restringir al mÃ­nimo las operaciones de dÃ³lar mayorista. Hoy hubo varias reuniones en el Palacio de Hacienda y el ministro cruzÃ³ varias veces a la Casa Rosada: las medidas que vendrÃ¡n\r\n', 'El segundo dÃ­a del gobierno de Javier Milei tendrÃ¡ tambiÃ©n restricciones para operar con dÃ³lares, incluso cuando la designaciÃ³n de los nuevos funcionarios a cargo de la autoridad monetaria, con Santiago Bausili a la cabeza, podrÃ­a formalizarse esta noche en el BoletÃ­n Oficial. AsÃ­ lo supo Infobae de altas fuentes de La Libertad Avanza.', '1', '30', '8925.jpg', '', '', '2023-12-11', '20:44:25', '1', NULL, '1', ''),
(3, 'InflaciÃ³n: continÃºan los aumentos preventivos de precios y algunas empresas frenaron las entregas', 'Durante el fin de semana se vieron nuevas remarcaciones en las listas que recibieron supermercados y algunos proveedores decidieron no entregar mercaderÃ­a a la espera de las medidas del nuevo Gobierno', 'No solo fue el virtual feriado cambiario y la suba en las cotizaciones del dÃ³lar minorista que registraron algunos bancos, en los Ãºltimos dÃ­as continuaron las remarcaciones preventivas de precios mientras que en algunos casos ya se registra una â€œpausa en las entregasâ€ en productos de consumo masivo, pero tambiÃ©n en otros rubros. Los agentes de la economÃ­a se encuentran a la espera de los primeros anuncios de Luis â€œTotoâ€ Caputo, con la expectativa de una devaluaciÃ³n acompaÃ±ada del incremento en rubros sensibles como tarifas y combustibles.', '4', '30', '4120.jpg', '', '', '2023-12-11', '20:45:04', '1', NULL, NULL, ''),
(4, 'CÃ³mo es el proceso de desregulaciÃ³n que el Gobierno analiza para la industria automotriz', 'Aunque todavÃ­a no hay anuncios concretos, se planea generar el marco adecuado antes de implementar cambios impositivos y regulatorios. Se eliminarÃ­an las SIRA y se intentarÃ¡ impulsar que los fabricantes exporten mÃ¡s del 70% de su producciÃ³n. Ahora la urgencia estÃ¡ en resolver el modo de cancelar los pagos al exterio', 'Los argentinos tendrÃ¡n que esperar un dÃ­a mÃ¡s para conocer las primeras medidas que anunciarÃ¡ Luis Caputo como Ministro de EconomÃ­a. La industria en general tiene grandes expectativas respecto al nuevo dÃ³lar y al modo de enfrentar la desregulaciÃ³n hacia la cual se ha decidido ir como objetivo primario en el plano econÃ³mico. Al igual que otros, el sector automotriz enfrenta el enorme de desafÃ­o de tener una â€œhoja de rutaâ€ a la cual ajustarse para continuar.', '4', '30', '3767.jpg', '', '', '2023-12-11', '20:46:03', '1', NULL, NULL, ''),
(5, 'Su â€œamenazaâ€ al Cuti Romero, la infiltraciÃ³n que pocos saben y cÃ³mo estudiÃ³ a los rivales: los secretos de Dibu MartÃ­nez en el Mundial', 'El arquero del Aston Villa reviviÃ³ momentos claves de la consagraciÃ³n de Qatar y aprovechÃ³ para explicar en detalle su atajada agÃ³nica a Kolo Muani', 'Emiliano MartÃ­nez fue uno de los grandes protagonistas de la consagraciÃ³n de la Copa del Mundo en Qatar. El guardameta del Aston Villa apareciÃ³ en los momentos claves del camino y coronÃ³ su actuaciÃ³n con la tanda de penales frente a Francia en el Lusail Iconic Stadium. A poco menos de un aÃ±o de tocar la gloria con la Albiceleste, el Dibu hizo un repaso de lo vivido y revelÃ³ detalles que todavÃ­a no se sabÃ­an sobre el proceso rumbo a la tercera estrella', '5', '30', '1364.jpg', '', '', '2023-12-11', '20:48:06', '1', NULL, NULL, '7351.mp4'),
(10, 'A la espera de anuncios econÃ³micos, en el primer dÃ­a de Milei presidente ya no quedaron dÃ³lares alternativos debajo de $1.000', 'La divisa libre subiÃ³ a $1.000 para la venta y los dÃ³lares bursÃ¡tiles se negociaron por encima de ese precio. La cotizaciÃ³n al pÃºblico subiÃ³ 18% y en algunos bancos superÃ³ los $1.200, aunque no hubo ventas por las restricciones. El S&P Merval ganÃ³ 3,7% y se acercÃ³ al millÃ³n de puntos por primera vez', 'El libertario asumiÃ³ este domingo 10 las riendas del Gobierno con la promesa de aplicar un plan ortodoxo que encarrile una economÃ­a devastada por la inflaciÃ³n y la pobreza, rodeado de una fervorosa multitud que se acercÃ³ al centro de Buenos Aires para celebrar con banderas argentinas.\r\n\r\nEl Banco Central dispuso aplicar este lunes la exigencia de una conformidad previa a todas las operaciones de demanda de dÃ³lares que se cursan a travÃ©s del mercado de cambios. La propia entidad explicÃ³ que â€œdurante la transiciÃ³n, las operaciones de cambio serÃ¡n analizadas y cursadas en funciÃ³n de las prioridadesâ€. En los hechos, la medida restringiÃ³ al mÃ¡ximo las transacciones, con el objetivo de dar tiempo a las nuevas autoridades a asumir sus cargos y ponerse en funciones.', '1', '30', '4474.jpg', '', '', '2023-12-11', '20:49:14', '1', NULL, NULL, ''),
(18, 'Premios Oscar 2024: Oppenheimer fue la gran ganadora de la noche con siete estatuillas', 'La ceremonia, que se realizÃ³ en el Dolby Theatre de Hollywood, distinguiÃ³ a los trabajos mÃ¡s destacados de la industria del Ãºltimo aÃ±o', 'DespuÃ©s de mucha expectativa, este domingo los Premios Oscar destacaron a las mejores pelÃ­culas del cine de Hollywood como del mundo. La ceremonia, que se llevÃ³ a cabo en el Dolby Theatre del Ovation Hollywood, resaltÃ³ el desempeÃ±o de actores, directores, vestuario, guiÃ³n y banda sonora de la industria.\r\n\r\nLa pelÃ­cula mÃ¡s nominada de esta 96Âª ediciÃ³n de los Premios de la Academia era Oppenheimer, la cual resaltÃ³ del resto con 13 nominaciones, entre ellas: Mejor Director, Mejor PelÃ­cula, Mejor Actor Principal y Mejor Actriz de Reparto. Mientras que en segundo lugar se ubicÃ³ Poor Things. La pelÃ­cula protagonizada por Emma Stone llegÃ³ con 11 nominaciones.\r\n\r\nUna vez mÃ¡s, el encargado de conducir la prestigiosa ceremonia fue Jimmy Kimmel. Con su estilo perspicaz, el actor â€“que ocupÃ³ este rol por cuarta vezâ€“ abriÃ³ la noche con un cÃ¡lido saludo al pÃºblico: â€œQue honor estar aquÃ­, gracias por recibirme de vuelta. Esta noche estÃ¡ llena de talentoâ€. Al mismo tiempo, tambiÃ©n hizo referencia al fenÃ³meno global que logrÃ³ Barbie: â€œAquÃ­ estamos celebrando lo mejor de lo mejor, empezamos con la pelÃ­cula mÃ¡s grande del aÃ±o. Que increÃ­ble logro tomar una muÃ±eca que ya a nadie le gustaba. Margot Robbie fue la que uniÃ³ todos estos esfuerzos. Margot, quiero que sepas que si no ganan un Oscar, igual ya ganaron algo mucho mÃ¡s importanteâ€.\r\n\r\nDespuÃ©s, Kimmel resaltÃ³ el otro Ã©xito del aÃ±o: â€œY luego tenemos al otro Ã©xito del aÃ±o, Oppenheimer, dirigida por el gran Christopher Nolan. Y su colaborador Cillian Murphy, felicidades a Robert Downey Jr tambiÃ©nâ€.\r\n\r\nâ€œNo pensÃ© que esta iba a ser mi carrera, empecÃ© como cantante y mi mamÃ¡ me dijo cruza a ese teatro, hay algo ahÃ­ para ti. Agradezco a mi madre por eso. Estoy agradecida con toda la gente aquÃ­, y por mucho tiempo quise ser distinta. Y ahora me doy cuenta que solo necesito ser yo misma. Te agradezco cuando yo era la Ãºnica chica negra en la clase y me dijiste que era suficiente y que Ã­bamos a forjar mi camino. Estoy agradecida con todas las mujeres que estuvieron a mi ladoâ€, dijo la actriz estadounidense al subir al escenario.', '1', '12', '9930.jpg', '', '', '2024-03-11', '15:08:31', '1', NULL, NULL, ''),
(14, 'Diego MartÃ­nez: de los \"dientes apretados\" y la \"muestra de carÃ¡cter\" a \"el equipo puede jugar mÃ¡s\"', 'El tÃ©cnico de Boca se fue muy conforme de la Bombonera y valorÃ³ la actitud de los futbolistas.', 'Diego MartÃ­nez terminÃ³ colgado de Marcos Rojo. Sonrisa de oreja a oreja y extasiado por el festÃ­n que se hizo Boca con Racing. AsÃ­ lo viviÃ³ el DT, asÃ­ lo analizÃ³. â€œFue muy importante la muestra de carÃ¡cter. Lo hablamos en la charla con los muchachos, que lo que tenÃ­a que dejar el partido con UniÃ³n era un aprendizaje. Si el equipo tenÃ­a la intensidad que mostrÃ³ en ciertos partidos que nos tocÃ³ jugar, si volvÃ­amos a tener esa cosa de jugar con dientes apretados Ã­bamos a estar mÃ¡s cerca de sacar adelanten un clÃ¡sico como el de hoyâ€, dijo el GigolÃ³.\r\n\r\nY agregÃ³: â€œEl de hoy (por este domingo) era el partido mÃ¡s importante del aÃ±o porque es el que nos tocaba jugar. HabÃ­a que entender que cada final que juguemos va a ser la mÃ¡s importanteâ€.\r\n\r\nSobre el partido, MartÃ­nez dijo que â€œRacing es un rival que tiene vocaciÃ³n ofensiva, que te obliga a jugar palo y paloâ€, que â€œse dio un partido abierto, entretenidoâ€, que â€œgeneramos situaciones mÃ¡s claras que Racing, es la sensaciÃ³n que tengoâ€ y que â€œen lÃ­neas generales fue un partido parejo y disputadoâ€.\r\n\r\nEso sÃ­, pese al conformismo con el que se fue de la Bombonera, el tÃ©cnico de 45 aÃ±os pidiÃ³ mÃ¡s de cara a lo que se le viene a Boca en la Copa de la Liga (Estudiantes en La Plata el domingo que viene) y en los estrenos de la Copa Argentina y Sudamericana.\r\n\r\nâ€œEl equipo puede jugar mÃ¡s y queremos que juegue mÃ¡s, no mejor, mÃ¡s y mÃ¡s tiempo. Cuando el equipo juega lo hace bien. No mejor, eh; mÃ¡s tiempo. Los cambios nos ayudaron para encontrar soluciones, fueron en el momento justo, el gol de Edi (Cavani) fue cuando cambiamos la estructura. Me voy muy contento por lo que demostraronâ€, cerrÃ³ MartÃ­nez.', '3', '18', '9897.jpg', '', '', '2024