(15, 'Otro round Tevez - DÃ³valo: carta documento y \"dÃ³nde te mando el sobre\"', 'El DT de Independiente mostrÃ³ la carta que le llegÃ³ por parte del Ã¡rbitro y le tirÃ³ un palo vÃ­a redes sociales. Sigue...\r\n', 'Pasaron los dÃ­as, las declaraciones cruzadas, los posteos y hasta un partido en el medio, pero el ida y vuelta entre Carlos Tevez y Pablo DÃ³valo sigue sumando capÃ­tulos. En un nuevo round de la disputa, el Ã¡rbitro le enviÃ³ una carta documento al DT de Independiente por \"expresiones agraviantes, injuriantes y calumniosas\", intimando a Tevez para que ratifique o rectifique en 24 horas esos dichos. Â¿QuÃ© hizo el Apache? Le tirÃ³ un palo vÃ­a redes...\r\n\r\n\"Hay Pablito Pablito... No hagamos perder tiempo a los abogados y decime dÃ³nde te mando el sobre\",. escribiÃ³ Tevez, mostrando la carta documento que le llegÃ³ vÃ­a Correo Argentino, y deslizando algo mÃ¡s en ese posteo picante como todos los anteriores.\r\n\r\nl ida y vuelta comenzÃ³ despuÃ©s del partido entre Barracas e Independiente (empate 2-2), en el que Tevez saliÃ³ enojado y tirando bombas contra el arbitraje en la conferencia de prensa. \"Es como que un chorro te avise que te va a robar y vaya y te robe\", soltÃ³ el DT del Rojo. El apuntado: Pablo DÃ³valo, juez de aquel encuentro, que tambiÃ©n tuvo un fuerte cruce con Laso.\r\n\r\nLa cuestiÃ³n no quedÃ³ ahÃ­. Pablo Toviggino, tesorero de la AFA, tambiÃ©n tirÃ³ con municiÃ³n gruesa en redes sociales y Tevez le respondiÃ³. Es mÃ¡s, al otro dÃ­a del partido, el entrenador y NÃ©stor Grindetti, presidente de Independiente, convocaron una conferencia de prensa para seguir con el tema. Si bien se bajÃ³ algÃºn decibel, ni Tevez ni el Rojo bajaron la guardia, al contrario... â€œSigo insistiendo en que nos robaron\" y â€œlo de Toviggino es personal, lo arreglamos en Twitter o donde Ã©l quieraâ€, dijo Carlos.\r\n\r\nLuego de eso, la AsociaciÃ³n Argentina de Ãrbitros anunciÃ³ que llevarÃ¡ a Tevez a la Justicia y lo hizo vÃ­a DÃ³valo. La carta documento le llegÃ³ al entrenador. EstÃ¡ fechada en 7 de marzo y el mismo Carlos la dio a conocer este domingo. En la misma, DÃ³valo da a conocer las declaraciones que hizo Tevez, \"en clara violaciÃ³n de mi buen honor y nombre\", suscribe el Ã¡rbitro.\r\n\r\n\"Intimole plazo legal 24 hs ratifique o rectifique las afirmaciones vertidas bajo apercibimiento de demandar penal y civilmente por los delitos de calumnias e injurias con mÃ¡s daÃ±os y perjuicios. Cabe aclara que para el caso de silencio de vuestra parte el mismo serÃ¡ interpretado como ratificaciÃ³n de sus dichos. Queda Ud. debidamente notificado\", cierra la carta. Â¿Y ahora?', '3', '18', '5568.jpg', '', '', '2024-03-11', '12:42:38', '1', NULL, NULL, ''),
(16, 'El Gobierno puso en marcha el comitÃ© de crisis en Rosario: â€œHoy ya hablamos de narcoterrorismoâ€', 'El ministro de Defensa de la NaciÃ³n, Luis Petri, anticipÃ³ que en las prÃ³ximas horas llegarÃ¡n personal y vehÃ­culos de las Fuerzas Armadas para cooperar con las fuerzas federales, cuya presencia se incrementarÃ¡ a partir de esta noche. â€œTenemos que terminar con el hormiguero entero, no sirve ir hormiga por hormigaâ€, dijo Patricia Bullrich\r\n', 'â€œHoy ya estamos hablando de narcoterrorismoâ€, asegurÃ³ la ministra de Seguridad, Patricia Bullrich al presentar el plan que se pondrÃ¡ en marcha desde hoy.\r\n\r\nPor su parte, el ministro de Defensa Luis Petri puntualizÃ³ que en las prÃ³ximas horas llegarÃ¡n las Fuerzas Armadas para ser sostÃ©n logÃ­stico y tÃ¡ctico de las fuerzas federales.\r\n\r\nEn los Ãºltimos dÃ­as hubo una ola de terror en Rosario con asesinatos perpetrados por las bandas narco que dominan la ciudad santafesina como respuesta a las medidas aplicadas por el gobierno local en las cÃ¡rceles en las que estÃ¡n detenidos los integrantes de los clanes violentos. El Ãºltimo fue el crimen de Bruno NicolÃ¡s Bussanich, un playero de 25 aÃ±os que fue ejecutado a sangre frÃ­a cuando cumplÃ­a con sus tareas habituales.\r\n\r\nTe puede interesar:\r\nEl Gobierno lleva mÃ¡s gendarmes y vehÃ­culos a Rosario para frenar la ola de crÃ­menes narcos que aterroriza a la ciudad\r\nEn ese contexto, la ministra Bullrich enumerÃ³ los puntos centrales del plan que piensan implementar para ponerle freno a la violencia narco que tiene en vilo a la ciudad santafesina:\r\n\r\n1) â€œVamos a pedirle a la Justicia la utilizaciÃ³n de la ley antiterrorista, para que toda acciÃ³n que tenga por objeto amedrentar a la poblaciÃ³n tenga doble penaâ€.\r\n\r\nTe puede interesar:\r\nEn medio del avance narco, Bullrich anunciÃ³ que denunciarÃ¡ los hechos de violencia en Rosario como â€œactos de terrorismoâ€\r\n2) â€œEstamos enviando al Congreso la ley antimafia o antibandas, que tipifica una nueva modalidad de persecuciÃ³n penal sobre las bandas, ajudicÃ¡ndoles los crÃ­menes a todos sus integrantes; como hizo el cÃ³digo penal de Italia para terminar con las mafias y luego Bukele contra las maras. Cada integrante llevarÃ¡ la pena de la organizaciÃ³nâ€.\r\n\r\n3) â€œEnviaremos efectivos de las fuerza federales, los primeros estÃ¡n llegando hoy a la noche, para generar saturaciÃ³n y sumaremos de 2 a 4 zonas de alto riesgo en la ciudad. Vamos a trabajar con equipos especiales de investigaciÃ³n para conformar el Ã¡rbol genealÃ³gico de las bandas que hoy actÃºan en Rosario. Haremos acciones de saturaciÃ³n en el horario crÃ­tico, de 17 a 7 de la maÃ±ana, para proteger la nocheâ€.\r\n\r\n4) â€œTrabajaremos fuerte sobre el lavado de dinero, el mÃ¡s oculto de los delitos que muchas veces no estÃ¡ en los barrios humildes sino en los de alta capacidad econÃ³mica de la ciudad. Iremos contra ellos con las procuraciones especializadas para cortarles el capital del trabajo a las organizacionesâ€.\r\n\r\n5) â€œSolicitaremos la apoyatura logÃ­stica de las Fuerzas Armadas y le vamos a pedir a la Justicia medidas excepcionales a la altura de lo que tenemos que afrontar. Queremos sacar las armas que han crecido y atentan contra la vida de la gente, tendremos reuniones confidenciales con los jueces para plantear un modelo diferente que nos permita controlar para lograr que Rosario no sea la ciudad con mÃ¡s armas del paÃ­sâ€.\r\n\r\nLuego de ese repaso punto por punto, Bullrich remarcÃ³ que necesitan la ayuda de los legisladores. \" Estas leyes nos van a permitir tomar al conjuntos de las bandas, necesitamos terminar con el hormiguero, no ir hormiga por hormigaâ€, considerÃ³. Y en la misma lÃ­nea, justificÃ³: â€œSino no ganamos nunca. Esto no es un problema de ganar, es un problema de hacerles la vida difÃ­cil, que no haya armas en cada casa, que no se genere una situaciÃ³n en la que una persona puede salir a cualquier hora con un arma y asesinar a una personaâ€.\r\n\r\nDurante otro tramo de su discurso, Bullrich comunicÃ³ que el presidente Javier Milei le encomendÃ³ a ella y al ministro Petri que lleven adelante â€œuna lucha sin cuartelâ€ con el objetivo de que Rosario â€œquede liberada de narcocriminalesâ€. En ese sentido, la titular de la cartera de Seguridad abogÃ³ por un trabajo mancomunado entre las autoridades nacionales y provinciales, dejando de lado quiÃ©n encabeza los trabajos. â€œNo es una cuestiÃ³n de quiÃ©n hace la operaciÃ³n, sino de hacerla. Jueces, fiscales, policÃ­a y gobierno provincial, gobierno nacional, fuerzas de seguridad federales, Fuerzas Armadas, todos juntos, junto a las polÃ­ticas de protecciÃ³n para que los chicos jÃ³venes no entren al delito, como hicimos con Barrios Seguros, antes de que sea un delivery o un narco que va a terminar muerto y que tiene una expectativa de vida de 5 o 6 aÃ±osâ€.\r\n\r\nâ€œNo nos van a doblar los brazos, no vamos a aflojar, no vamos a dejar que Rosario sea una tierra de narcoterroristas. Estamos en un momento difÃ­cil, pero la vida de todos los ciudadanos la vamos a proteger con todos los mediosâ€, concluyÃ³ la funcionaria.\r\n\r\nA continuaciÃ³n tomÃ³ la palabra el gobernador de Santa Fe, Maximiliano Pullaro, quien se lamentÃ³ en pÃºblico por las horas de â€œprofundo dolorâ€ que atraviesa el pueblo rosarino tras los sangrientos episodios que ocurrieron en los Ãºltimos dÃ­as.\r\n\r\nâ€œNo vamos a escatimar ningÃºn recurso para dar con los responsables materiales. Hemos avanzado pero no quiero dar datos. Queremos dar con los responsables intelectuales. El Gobierno de Santa Fe ofrece una recompensa de 10 millones de pesos para el que nos de datos certeros y nos permita saber quiÃ©nes fueron todos los que planificaron estos hechos y quienes los ejecutaronâ€, subrayÃ³ el mandatario provincial ante la prensa, en lÃ­nea con las declaraciones brindadas previamente por los funcionarios nacionales.\r\n\r\nPor Ãºltimo, Pullaro advirtiÃ³: â€œVamos a dar con cada uno de ellos y van a pasar toda su vida pudriÃ©ndose en la cÃ¡rcel porque van a tener la pena de prisiÃ³n perpetua. Hay una determinaciÃ³n inquebrantable para terminar con las mafias en la provincia de Santa Feâ€.\r\n\r\nTemas Relacionados', '3', '30', '6843.jpg', '', '', '2024-03-11', '12:44:37', '1', NULL, '29', ''),
(17, 'El mensaje de Ãngel Di MarÃ­a en medio de la ola de violencia en Rosario', 'El referente de la selecciÃ³n argentina utilizÃ³ sus redes sociales para enviar un pedido de paz frente a los recientes asesinatos de civiles en su ciudad', 'Luego de cuatro asesinatos a manos de sicarios, la ciudad de Rosario se encuentra paralizada: diversos sectores decidieron realizar medidas medidas de fuerza, como precauciÃ³n ante la inseguridad y para reclamar protecciÃ³n frente a la avanzada de la violencia narco. La problemÃ¡tica cada vez crece mÃ¡s y dentro de las personalidades reconocidas que mostraron su preocupaciÃ³n por la tensa situaciÃ³n que vive la ciudad apareciÃ³ Ãngel Di MarÃ­a, actual futbolista de la SelecciÃ³n y el Benfica de Portugal.\r\nSurgido en Rosario Central, el Fideo utilizÃ³ sus redes sociales para hacer un pedido de paz. El extremo publicÃ³ en su cuenta de Instagram una foto en la que se puede ver al Monumento de la Bandera rodeado por un listÃ³n negro y lo acompaÃ±Ã³ con un emoji de dos manos juntas pidiendo por favor. â€œPedimos pazâ€, recitÃ³ la imagen que seleccionÃ³ el referente de la Albiceleste para plantar su opiniÃ³n sobre el tema. No es la primera vez que el jugador se expresa a travÃ©s de internet ya que en su momento se quejÃ³ por el trato que recibieron los hinchas de la Academia en la final de la Copa de la Liga 2023 frente a Platense.\r\n\r\nVale recordar que los hinchas del Canalla siguen expectantes al regreso de Ãngel y sueÃ±an con verlo vestir la camiseta en el Gigante de Arroyito una vez mÃ¡s antes de su retiro como futbolista profesional. â€œEn mi cabeza siempre estuvo. Como estuvo volver al Benfica, estÃ¡ volver a Central. Lo dije muchÃ­simo. No me gusta mucho hablar del tema porque despuÃ©s empiezan con que siempre hablo y nunca termina pasando, pero el fÃºtbol es asÃ­. Te va llevando. Siempre dije que querÃ­a volver cuando todavÃ­a me sienta bien, y creo que estoy en plenitud todavÃ­aâ€, admitiÃ³ en varias oportunidades.\r\n\r\nY aÃ±adiÃ³ al respecto de la traba contractual para regresar en condiciÃ³n de futbolista libre: â€œMi contrato acÃ¡ se termina a mediados de 2024 y es obvio que estÃ¡ esa opciÃ³n. Tengo muy buena relaciÃ³n con Gonzalo (Belloso, presidente de Rosario Central). Hablo bastante con Ã©l. Ã‰l sabe que tengo esa intenciÃ³n. SÃ© que las puertas estÃ¡n abiertas y cuando se tenga que dar, se darÃ¡. Ahora, estoy feliz acÃ¡. QuerÃ­a venir un aÃ±o para disfrutar de Lisboa otra vezâ€, seÃ±alÃ³ sobre su decisiÃ³n de firmar con Benfica.\r\n\r\nTe puede interesar:\r\nCampeones del mundo y figuras: de la atajada del Dibu MartÃ­nez para salvar al Aston Villa al gol de Di MarÃ­a que rescatÃ³ al Benfica\r\nDi MarÃ­a debutÃ³ profesionalmente en Rosario Central en 2005 y dos aÃ±os mÃ¡s tarde fue vendido al Benfica a cambio de mÃ¡s de 8 millones de dÃ³lares. Tras tres temporadas, Real Madrid comprÃ³ su ficha en 33 millones. AdemÃ¡s, Fideo brillÃ³ en otros clubes como el Manchester United, PSG y Juventus.', '4', '18', '3947.jpg', '', '', '2024-03-11', '12:46:10', '1', NULL, '1', ''),
(19, 'QuÃ© cambios hizo Kate Middleton a la fotografÃ­a con sus hijos que generÃ³ tanto escÃ¡ndalo\r\n', 'La princesa de Gales ha confesado que fue ella quien editÃ³ la imagen de su reapariciÃ³n, en la que aparece junto a sus hijos\r\n', 'Tras varias horas de polÃ©mica e intriga, Kate Middleton ha confesado en la maÃ±ana de este lunes 11 de marzo que es la autora de los retoques digitales de la fotografÃ­a que el palacio de Kensington publicaba el domingo con motivo del DÃ­a de la Madre. Si bien se pretendÃ­a que la instantÃ¡nea fuera su gran reapariciÃ³n tras dos meses â€˜desaparecidaâ€™ despuÃ©s de realizarse una cirugÃ­a abdominal a comienzos de enero, el resultado ha sido totalmente el contrario. No solo no se han puesto punto final a los rumores sobre su estado de salud, sino que estos han aumentado.\r\n\r\nComo consecuencia, la Casa Real britÃ¡nica estÃ¡ recibiendo una gran presiÃ³n para que se publique la fotografÃ­a original de la princesa de Gales y sus hijos, y es que se ha entendido que si Kate ha querido manipular digitalmente el retrato es porque habrÃ­a algo que â€˜esconderâ€™.\r\n\r\nComo muchos fotÃ³grafos aficionados, de vez en cuando experimento con la ediciÃ³n. QuerÃ­a expresar mis disculpas por cualquier confusiÃ³n que haya causado la fotografÃ­a familiar que compartimos ayer. Espero que todos los que celebran hayan tenido un muy feliz DÃ­a de la Madreâ€, escribiÃ³ Middleton en este comunicado, entonando asÃ­ el mea culpa.\r\n\r\nSobre los retoques que hay en la fotografÃ­a, medios britÃ¡nicos como Daily Mail, con ayuda de expertos en ediciÃ³n, no han tardado en realizar detalladas listas sobre las modificaciones que se pueden encontrar en la imagen y que no son pocas.\r\n\r\nEmpezando por la parte superior de la imagen se puede ver que el brazo derecho de George el borde del jersey parece artificial; que la parte superior del pelo de Kate estÃ¡ un tanto borroso y que el cabello de su hija termina abruptamente en el hombro derecho. Un poco mÃ¡s abajo se puede apreciar que la mano derecha de Kate estÃ¡ borrosa, pero no el jersey de su hijo, en el que se apoya. AdemÃ¡s, la cremallera de la princesa de Gales estÃ¡ mÃ¡s a la izquierda de lo que deberÃ­a y el pelo de Charlotte sigue teniendo una forma extraÃ±a en las puntas.\r\n\r\nEn Charlotte se pueden encontrar tres detalles mÃ¡s que son curiosos: un espacio hueco en su mano donde deberÃ­a estar la manga, una esquina demasiado artificial en el borde de su falda y una rodilla en un Ã¡ngulo poco natural. Por su parte, el prÃ­ncipe Louis tiene el pulgar derecho borroso y su Ã­ndice termina abruptamente. En cuanto al entorno, lo que mÃ¡s llama la atenciÃ³n es el muro sobre el que estÃ¡ el hijo pequeÃ±o de Kate, pues los bordes estÃ¡n distorsionados en varios puntos.\r\n\r\nTambiÃ©n se han conocido datos sobre cÃ³mo fue hecha la fotografÃ­a, cuyo autor es el prÃ­ncipe Guillermo. El medio Sky News la ha analizado al detalle a travÃ©s de sus metadatos y ha concluido que el archivo se hizo con una Canon 5D mark IV, cuyo precio supera los 3.000 euros en la pÃ¡gina oficial de la marca, y con un objetivo Canon de 50 mm, valorado en unos 1.500 euros. AdemÃ¡s, la fotografÃ­a se editÃ³ con el programa Adobe Photoshop, que fue usado en un ordenador Mac.', '7', '12', '8013.jpg', '', '', '2024-03-11', '16:15:26', '1', NULL, NULL, ''),
(20, 'Juega en Instagram sin internet: cÃ³mo ingresar al videojuego oculto desde mi cuenta', 'La aplicaciÃ³n de Meta permite jugar con los emojis como ninguna otra red social\r\n', 'SÃ­, Instagram tiene un videojuego integrado que muy pocos usuarios conocen. Aunque no una experiencia de juego muy compleja, sÃ­ es una alternativa divertida que podemos usar sin ningÃºn problema y sin necesidad de tener conexiÃ³n a internet.\r\nPara quienes crecieron en los 90, el juego al que brinda acceso la aplicaciÃ³n de Meta les recordarÃ¡ al clÃ¡sico Arkanoid, que consistÃ­a en mantener una pelota rebotando contra ladrillos, mientras nosotros evitÃ¡bamos que se escapara con una plataforma en la parte de abajo.\r\n\r\nLa experiencia en la aplicaciÃ³n de Meta es algo similar, aunque no tendremos ladrillos y la pelota la cambiaremos por un emoji. Nuestro objetivo serÃ¡ durar la mayor cantidad de tiempo posible.\r\nCÃ³mo acceder al juego de Instagram\r\nEsta es una opciÃ³n que estÃ¡ habilitada para todos los usuarios de la red social y es posible acceder a ella desde el celular, sea Android o iOS, sin necesidad de un pago adicional o descargar otra aplicaciÃ³n. Lo Ãºnico que necesitamos es un chat de Instagram, siguiendo estos pasos:\r\n\r\nAbrir Instagram.\r\nIr a la secciÃ³n Chats y buscar cualquier conversaciÃ³n.\r\nDesde el teclado, enviar un emoji.\r\nPulsar una vez sobre el emoji.\r\nCon esto serÃ¡ suficiente para que el juego inicie. Incluso lo podemos ejecutar sin necesidad de conexiÃ³n a internet, por lo que puede ser una soluciÃ³n para distraernos si no tenemos seÃ±al o WiFi.\r\n\r\nAunque el juego es sencillo, puede convertirse en un reto porque la idea es superar nuestro propio rÃ©cord al evitar que el emoji caiga, ya que con el tiempo irÃ¡ aumentando de velocidad y serÃ¡ mucho mÃ¡s difÃ­cil controlarlo.\r\nAdemÃ¡s, hay otros factores interesantes como que la pantalla va cambiando de color segÃºn la cantidad de puntos y algunos emojis se transforman, como el caso del gusano que se convierte en mariposa.\r\n\r\nTe puede interesar:\r\nSe cayÃ³ Instagram: cÃ³mo ingresar a la cuenta si olvidÃ© mi contraseÃ±a\r\nLo estuvimos probando con diferentes emojis y con todos fue posible jugar, mostrando siempre el mejor puntaje que se haya logrado sin importar el diseÃ±o o el chat desde el que hayamos ingresado al juego.\r\n\r\nSin embargo, por ahora no hay una forma de compartir ese puntaje a travÃ©s de una historia o publicaciÃ³n, tampoco se puede retar a un amigo a que cada uno logre aguantar la mayor cantidad de tiempo posible.\r\n\r\n\r\ninco funciones nuevas en los chats de Instagram\r\nFijar chats en la zona superior de la bandeja de entrada:\r\nInstagram facilita el acceso a los chats con los mejores amigos o familiares que mÃ¡s se utilizan a diario, gracias a esta herramienta que permite fijar hasta tres conversaciones y no permitir que bajen a pesar de recibir mensajes de otros contactos.\r\n\r\nEditar un mensaje:\r\nAl igual que en WhatsApp, la aplicaciÃ³n la opciÃ³n de editar un mensaje hasta 15 minutos despuÃ©s de enviarlo. Para hacerlo hay que presionarlo y modificarlo, evitando la necesidad de borrarlos o enviar correcciones mediante nuevos mensajes.\r\n\r\nDesactivar confirmaciÃ³n de lectura:\r\nEsta es una herramienta de privacidad que le darÃ¡ libertad al usuario de contestar los mensajes sin que la otra persona vea que ya los leyÃ³. Para activarlo hay que dirigirse a la secciÃ³n â€˜Privacidad y seguridadâ€™ dentro de la configuraciÃ³n del perfil.\r\n\r\nPersonalizaciÃ³n de fondos:\r\nInstagram permite cambiar la imagen de fondo de las conversaciones con temas que incluyen diseÃ±os romÃ¡nticos, de alimentos y dulces, asÃ­ como de importantes producciones recientes como Avatar y Dune.\r\n\r\nTe puede interesar:\r\nCÃ³mo recuperar fotos y videos borrados de Instagram\r\nPara hacer este cambio solo se requiere pulsar el fondo del chat y seleccionar el tema que se desee utilizar.\r\n\r\nGuardar stickers:\r\nTambiÃ©n, es posible guardar los stickers para usarlos en otra conversaciÃ³n o momento. Para ello se debe mantener el dedo pulsado sobre el mismo y posteriormente, se encontrarÃ¡ en la parte superior de la bandeja de stickers de mensajes directos.', '7', '31', '7827.jpg', '', '', '2024-03-11', '16:17:06', '1', NULL, '1', ''),
