(31, 'Inter Miami mejorÃ³ la oferta por Chelo Weigandt: los otros 4 argentinos que tiene en carpeta si no llega a un acuerdo con Boca Juniors\r\n', 'El defensor xeneize es el principal apuntado, pero no el Ãºnico del equipo que comanda Lionel Messi en la MLS\r\n', 'a negociaciÃ³n no comenzÃ³ del mejor modo, ya que el equipo de Florida no cumpliÃ³ las expectativas econÃ³micas del Xeneize para dejarlo ir y habrÃ­a ofrecido en un inicio 150 mil dÃ³lares. El equipo argentino lo rechazÃ³ automÃ¡ticamente y sentaron como base para negociar el millÃ³n de dÃ³lares (segÃºn Transfermarkt, su pase vale poco mÃ¡s de 2 millones de dÃ³lares).\r\n\r\nEn las Ãºltimas horas, el elenco de la Major League Soccer de Lionel Messi enviÃ³ una nueva oferta, que habrÃ­a vuelto a ser rechazada. El monto que se ofreciÃ³ fue de 300 mil dÃ³lares, el doble de lo ofrecido al comienzo, pero esto tampoco satisfizo al Consejo de FÃºtbol.\r\n\r\nDesde ambos bandos afirman que seguirÃ¡n negociando e incluso se hablÃ³ de la posibilidad de que Marcelo Weigandt renueve con Boca Juniors por cuatro aÃ±os y luego sea cedido a prÃ©stamo al Inter Miami por dos temporadas. Hasta el momento, desde el Xeneize no contestaron esta nueva propuesta del entorno del jugador..', '3', '18', '9099.jpg', '', '', '2024-03-13', '20:14:07', '1', NULL, '24', ''),
(32, 'Violencia en Rosario: el Ministerio de Justicia adelantÃ³ las medidas del Gobierno para combatir el narcotrÃ¡fico\r\n', 'La cartera, a cargo de Mariano CÃºneo Libarona, informÃ³ sobre los nuevos lineamientos para ayudar a jueces y fiscales y acelerar las causas. Lo hizo tras la ola de violencia en la que mataron a dos taxistas, un colectivero y un playero\r\n', 'SegÃºn lo que se informÃ³ oficialmente, estas medidas abarcan cinco ejes centrales: la implementaciÃ³n del sistema acusatorio; una reforma del CÃ³digo Penal; cubrir las vacantes en el sistema judicial; la â€œextinciÃ³n de dominioâ€; el fortalecimiento de la delegaciÃ³n de la UIF (Unidad de InformaciÃ³n Financiera de Rosario) y la creaciÃ³n de nuevos espacios de trabajo.\r\n\r\nEn ese contexto, la implementaciÃ³n del Sistema Acusatorio busca intensificar la â€œpersecuciÃ³n penal contra el crimen organizadoâ€, especialmente en casos de narcotrÃ¡fico, ofreciendo un â€œmÃ¡ximo apoyo a jueces y fiscales en sus investigaciones para acelerar el proceso de llevar estas causas a juicio. AdemÃ¡s, se asignarÃ¡ al Ministerio PÃºblico Fiscal la responsabilidad de gestionar investigaciones de mayor complejidad.\r\n\r\nEn cuanto a reformas legales, se pondrÃ¡ en marcha la creaciÃ³n de â€œuna comisiÃ³n encargada de revisar el CÃ³digo Penalâ€, con el objetivo de incluir â€œnuevas conductas punibles y aumentar las penas relacionadas con narcotrÃ¡fico, crimen organizado y delitos afinesâ€.', '2', '30', '7624.jpg', '', '', '2024-03-13', '20:45:50', '1', NULL, '48', ''),
(33, 'Con Messi de titular, Inter Miami va por el pase a los cuartos de final de la Concachampions', 'Desde las 21:15 (hora argentina), las Garzas van por la clasificaciÃ³n frente a Nashville (la ida fue 2-2). Transmite Star+\r\n', 'Horarios del partido entre Inter Miami y Nashville SC:\r\n\r\n21.15 Argentina (Star+)\r\n\r\n21.15 Brasil, Uruguay y Paraguay\r\n\r\n20.15 Estados Unidos (Este) y Chile\r\n\r\n19.15 Estados Unidos (Central), Bolivia y Venezuela\r\n\r\n18.15 Ecuador, PerÃº y Colombia\r\n\r\n17.15 Estados Unidos (MontaÃ±a) y MÃ©xico)\r\n\r\n16.15 Estados Unidos (PacÃ­fico)\r\n\r\n20:17 hs\r\nHOY\r\nFORMACIÃ“N CONFIRMADA DE INTER MIAMI\r\n\r\nDrake Callender; Julian Gressel, TomÃ¡s AvilÃ©s, Sergiy Kryvtsov, NicolÃ¡s Freire, Jordi Alba; Federico Redondo, Sergio Busquets, Diego GÃ³mez; Lionel Messi y Luis SuÃ¡rez. DT: Gerardo Martino.\r\n\r\n20:01 hs\r\nHOY\r\nCuÃ¡ndo se volverÃ¡n a enfrentar\r\n\r\nInter Miami recibirÃ¡ a Nashville en el Chase Stadium el prÃ³ximo sÃ¡bado 20 de abril a partir de las 20:30 (hora argentina) por la fecha 9 de la MLS.\r\n\r\n19:30 hs\r\nHOY\r\nEl historial entre Inter Miami y Nashville\r\n\r\nSe enfrentaron en 11 ocasiones con 4 victorias del Nashville, 2 triunfos del Inter Miami y 5 empates en el tiempo reglamentario.\r\n\r\n18:55 hs\r\nHOY\r\nLas otras llaves que restan resolverse en la Concachampions\r\n\r\nâ€¢ Inter Miami (2) vs. (2) Nashville\r\n\r\nâ€¢ Robinhood (0) vs. (2) Herediano\r\n\r\nâ€¢ AmÃ©rica (3) vs. (0) Chivas\r\n\r\nâ€¢ Alajuelense (0) vs. (4) New England\r\n\r\nâ€¢ Rayados de Monterrey (1) vs. (0) Cincinnati\r\n\r\n18:35 hs\r\nHOY\r\nQuiÃ©nes ya estÃ¡n clasificados a los cuartos de final de la Concachampions\r\n\r\nHay tres equipos que esperan entre los ocho mejores del mÃ¡ximo torneo de la Concacaf: Columbus Crew venciÃ³ 2-1 a Houston Dynamo, Pachuca goleÃ³ 6-0 a Philadelphia Union y Tigres derrotÃ³ 4-2 a Orlando City.\r\n\r\n17:37 hs\r\nHOY\r\nÂ¿CÃ³mo le fue a Inter Miami en el inicio de 2024?\r\n\r\nLas Garzas tuvieron una pretemporada con saldo negativo despuÃ©s de lograr una victoria en siete compromisos, pero dejaron atrÃ¡s ese arranque con el triunfo 2-0 a Real Salt Lake, el empate sobre la hora a Los Ãngeles Galaxy y la goleada 5-0 a Orlando City en el comienzo de la Major League Soccer (MLS). Tras igualar en Tennessee por la ida de la Concachampions, los de Florida preservaron a Lionel Messi (no fue convocado) y Luis SuÃ¡rez (entrÃ³ desde el banco) en la caÃ­da del domingo pasado contra MontrÃ©al (2-3), la primera del aÃ±o.\r\n\r\n16:30 hs\r\nHOY\r\nLionel Messi sorprendiÃ³ y posÃ³ como modelo para una marca de ropa de Arabia Saudita\r\nLa Pulga luciÃ³ la indumentaria tÃ­pica para protagonizar la publicidad de una distinguida firma de moda de Medio Oriente', '1', '18', '3058.jpg', '', '', '2024-03-13', '20:47:02', '1', NULL, '6', ''),
(34, 'Choque y derrumbe del puente en EEUU: el desesperado llamado que evitÃ³ una catÃ¡strofe mayor\r\n', 'El gobernador del estado de Maryland confirmÃ³ que la tripulaciÃ³n del buque contenedor advirtiÃ³ sobre el inminente impacto. CuÃ¡l fue la maniobra clave.\r\n', 'El gobernador del estado de Maryland confirmÃ³ que hubo un llamado de auxilio que permitiÃ³ salvar vidas en medio del derrumbe del puente Francis Scott Key Bridge en Baltimore, Estados Unidos.\r\n\r\nWes Moore explicÃ³ que la tripulaciÃ³n del buque contenedor conocido como â€œDalÃ­â€ logrÃ³ advertir que no podÃ­an detener la embarcaciÃ³n por la velocidad a la que iban y que se iba a generar un impacto contra el puente.\r\n\r\nLeÃ© tambiÃ©n: Video: un puente se desplomÃ³ tras ser impactado por un barco en Baltimore\r\n\r\nâ€œEsas personas son hÃ©roes, salvaron vidas anocheâ€, dijo el gobernador, quien explicÃ³ que el llamado de auxilio logrÃ³ detener a los autos que iban camino al puente Francis Scott Key Bridge y asÃ­ evitar que hubiera vÃ­ctimas.\r\n\r\nDe acuerdo a los detalles que brindÃ³ Moore, la nave se desplazaba a una velocidad de ocho nudos, unos 15 kilÃ³metros por hora, y alertÃ³ a las autoridades de que iba perdiendo fuerza.\r\n\r\nLos propietarios de la empresa Grace Ocean Investment detallaron que, al igual que en el primer accidente, nadie de la tripulaciÃ³n resultÃ³ herido pese a que varias personas tuvieron que arrojarse al agua una vez que se produjo el choque.\r\n\r\nLa compaÃ±Ã­a tambiÃ©n asegurÃ³ que hasta el momento se desconoce la causa del choque, aunque confirmÃ³ que se estÃ¡n realizando las investigaciones para conocer los detalles.', '4', '12', '2936.jpg', 'TH3K1oM_yQU', '', '2024-03-26', '16:48:18', '1', NULL, '2', ''),
(35, 'El FMI le reclamÃ³ al Gobierno revisar el ajuste para evitar que caiga sobre la clase trabajadora\r\n', 'El representante del organismo de crÃ©dito en la regiÃ³n llamÃ³ a las autoridades a â€œsostener los esfuerzos para apoyar a los segmentos mÃ¡s vulnerablesâ€. DestacÃ³ la baja de la inflaciÃ³n y el superÃ¡vit fiscal.\r\n', 'El representante del Fondo Monetario Internacional (FMI) en la regiÃ³n, Rodrigo ValdÃ©s, le reclamÃ³ al Gobierno â€œrevisar la calidad del ajusteâ€ y pidiÃ³ que los controles cambiarios sean equilibrados â€œde forma muy cuidadosaâ€.\r\n\r\nâ€œLas nuevas autoridades estÃ¡n implementando de forma decisiva un plan ambicioso de estabilizaciÃ³n para alejar la economÃ­a de la crisis y restaurar la macroestabilidad. El plan estÃ¡ focalizado en un ancla fiscal muy fuerte que elimina cualquier financiamiento del Banco Central al Gobierno para aumentar las reservasâ€, comenzÃ³ detallando el director del Departamento del Hemisferio Occidental del Fondo en el Foro IEFA Latam, que se desarrolla este martes en Buenos Aires.\r\n\r\nLeÃ© tambiÃ©n: El campo expresÃ³ su malestar ante un posible incremento del Impuesto Inmobiliario Rural del 200% en Entre RÃ­os\r\n\r\nEn el mismo sentido destacÃ³ que el proceso fue â€œimpresionanteâ€ porque llevÃ³ a un superÃ¡vit fiscal en general y remarcÃ³ que el registrado en enero y febrero fue el mayor de los Ãºltimos diez aÃ±os.\r\n\r\nâ€œLas reservas internacionales se estÃ¡n reconstruyendo, la inflaciÃ³n estÃ¡ cayendo mÃ¡s rÃ¡pidamente de lo que anticipÃ¡bamos y los indicadores de mercado, como la brecha cambiaria, el mercado paralelo y el riesgo paÃ­s, siguen mejorandoâ€, especificÃ³.', '4', '13', '1379.jpg', 'OO2vSn5DPJM', '', '2024-03-26', '16:56:04', '1', NULL, '2', '');
