(36, 'Violencia narco en Rosario: hay paro de colectiveros y taxistas luego de una nueva ola de ataques\r\n', 'Un micro de la lÃ­nea 143 Negra fue atacado y se intenta determinar de quÃ© fueron los impactos. La UTA anunciÃ³ que no habrÃ¡ servicio desde esta medianoche. TambiÃ©n se sumaron los taxis.\r\n', 'La seccional Rosario de la UniÃ³n Tranviarios Automotor (UTA) decretÃ³ un paro de colectivos luego de un nuevo ataque contra un micro este lunes en la zona sur de Rosario, luego de tres agresiones a colectivos y una amenaza, informÃ³ SebastiÃ¡n Domenech en Arriba Argentinos, por eltrece.\r\n\r\nLos taxistas tampoco circularÃ¡n.\r\n\r\nLa medida de fuerza, que afecta a servicios urbanos e interurbanos, comenzÃ³ la noche de este lunes y se extenderÃ¡ durante este martes.\r\n\r\nLeÃ© tambiÃ©n: La amenaza a Ãngel Di MarÃ­a en Rosario: el estremecedor texto completo\r\n\r\nEs la segunda vez en la jornada que se suspende el servicio de colectivos, ya que iniciaron una medida de fuerza durante la madrugada del lunes por un mensaje intimidatorio recibido y en la tarde habÃ­an vuelto a circular.\r\n\r\nAsÃ­ quedÃ³ uno de los colectivos de la lÃ­nea 143 Negra tras el ataque esta noche, donde afortunadamente no hubo heridos. (Foto: TN)\r\nEn el ataque al micro de la lÃ­nea 143 Negra esta noche no hubo que lamentar personas heridas y se intenta determinar de quÃ© fueron los impactos.\r\n\r\nTres ataques a colectivos y una amenaza en Rosario en plena escalada de violencia narco\r\nEl lunes por la noche hubo tres ataques a colectivos y una amenaza en Rosario en medio de la escalada de violencia vinculada al narcotrÃ¡fico, a un Expreso en Las Flores, un interno del Expreso interurbano que fue atacado sobre la autopista Rosario-Buenos Aires, inicialmente reportado como una agresiÃ³n con piedras aunque luego se denunciÃ³ que fue una balacera. Sumado al ataque a una unidad de la lÃ­nea 143 a la altura del arroyo Saladillo, a una amenaza hallada en un asiento de un 110 y al caso de una conductora de la 126 que escuchÃ³ tres disparos mientras circulaba por Crespo y Virasoro.\r\n\r\nNo hubo taxis durante la madrugada\r\nPor su parte, el secretario general del Sindicato de Peones de Taxis, Horacio Yanotti, anunciÃ³ en la noche de este lunes que decretaron â€œun cese de actividades hasta maÃ±ana (martes) a las 6 de la maÃ±ana, en una decisiÃ³n que busca resguardar la integridad de nuestros trabajadoresâ€.', '4', '13', '9742.jpg', '', 'RJlcj0Cxs_I', '2024-03-26', '16:59:37', '1', NULL, '4', ''),
(37, 'El dolor de la mujer del prefecto asesinado en Villa Fiorito: â€œHoy tenÃ­amos que festejar nuestro aniversarioâ€\r\n', 'Carlos Loira fue baleado cuando se dirigÃ­a a hacer un reparto de verduras del emprendimiento familiar. â€œNo sabÃ­a cÃ³mo decirles a mis hijos que me perdonaran, que por culpa de mi trabajo los dejÃ© sin papÃ¡â€, se lamentÃ³ la mujer.\r\n', 'Este lunes, Carlos Loira, un miembro de la Prefectura Naval Argentina (PNA) fue asesinado en un intento de robo en Villa Fiorito, localidad bonaerense de Lomas de Zamora. El hombre habÃ­a llegado de trabajar cuando vio que su esposa estaba por salir a hacer un reparto de verduras de su emprendimiento y le dijo que Ã©l se encargaba. Apenas habÃ­a hecho unas cuadras cuando se cruzÃ³ con cinco delincuentes\r\n\r\nLa vÃ­ctima fue abordada por los ladrones en la intersecciÃ³n de las calles Mario Bravo y Ginebra. AllÃ­, recibiÃ³ un tiro en el abdomen y muriÃ³ poco despuÃ©s de llegar a la Unidad de Pronta AtenciÃ³n (UPA) de la zona.\r\n\r\nLeÃ© tambiÃ©n: Lomas de Zamora: asesinaron a un prefecto en Villa Fiorito cuando intentaron robarle la camioneta\r\n\r\nâ€œSalÃ­a a hacer un reparto de verduras cuando lo atacaron y lo mataron, apenas pudo llegar al UPAâ€, lamentÃ³ Sonia, su esposa, en diÃ¡logo con Arriba Argentinos (eltrece). La mujer asegurÃ³ que todavÃ­a no puede creer la pesadilla que vive desde la noche de ayer. â€œQuiero retroceder el tiempoâ€, dijo entre lÃ¡grimas. â€œÃ‰l me decÃ­a que no trabaje mÃ¡s, que ya era bastante pero los compromisos de uno son peores, uno busca la manera de salir adelanteâ€, expresÃ³.\r\n\r\nâ€œMe dijo â€˜bajate de la camioneta, voy yoâ€™. Ã‰l venÃ­a de trabajar y antes de salir me dijo: â€˜Â¿no me vas a dar un beso?â€™ En el alboroto le doy un beso, se va y a los cinco minutos me llamaba la mujer desesperada y me dice â€˜Sonia, por favor venÃ­, le dispararon a tu esposoâ€, precisÃ³ entre lÃ¡grimas.', '4', '30', '8292.jpg', '-hwQhoXPmbk', '', '2024-03-26', '17:00:46', '1', NULL, '3', '');
