(2, 'frase', 'La excelencia es la nota constante que define nuestra misiÃ³n. Nos esforzamos por ofrecerte una experiencia sonora excepcional, fusionando diversidad musical y calidad tÃ©cnica con pasiÃ³n y dedicaciÃ³n inigualables.', NULL),
(3, 'Escuchanos en vivo!', '24hs de mÃºsica y de la mejor compaÃ±Ã­a, cada espacio creado y diseÃ±ado para que seas parte, para que puedas sumarte y nos ayudes a hacer radio!', NULL),
