(6, 'Inicio', 'My Radio, sintoniza de manera virtual la mejor programaciÃ³n de la red ', NULL),
(7, 'Nuestra Aplicacion', 'Disfruta de nuestra aplicaciÃ³n mÃ³vil, la cual te permitirÃ¡ escuchar a tiempo real nuestro contenido. con la fiabilidad de los servidores de alta gamma que tenemos para ofrecerte.\r\nConÃ©ctate a nuestra Radio Online', NULL),
(8, 'Fotos', 'EnvÃ­anos tu mensaje, nos gustarÃ­a te sumes y seas parte de la radio! Todos tenemos algo para decir!', NULL),
(9, 'Nuestra Historia', 'En los albores de la era digital, en la dÃ©cada de 1990, un pequeÃ±o equipo de visionarios se uniÃ³ con el sueÃ±o de democratizar el acceso a la informaciÃ³n. Inspirados por el potencial de Internet, decidieron crear una plataforma en lÃ­nea que ofreciera noticias de manera rÃ¡pida, precisa y accesible para cualquier persona en el mundo.\r\n\r\nEl proceso no fue fÃ¡cil. En una Ã©poca en la que la tecnologÃ­a web estaba en paÃ±ales, enfrentaron desafÃ­os tÃ©cnicos significativos para desarrollar la infraestructura necesaria. Sin embargo, con determinaciÃ³n y perseverancia, lograron superar obstÃ¡culos y lanzaron su sitio web de noticias a mediados de la dÃ©cada.\r\n\r\nInicialmente, la audiencia fue limitada, pero la calidad del contenido y el enfoque en la objetividad y la veracidad atrajeron la atenciÃ³n de los primeros usuarios de Internet. Con el tiempo, la web de noticias se convirtiÃ³ en un destino confiable para aquellos que buscaban informaciÃ³n precisa y actualizada sobre eventos locales, nacionales e internacionales.\r\n<br><br>\r\nA medida que Internet creciÃ³ y evolucionÃ³, tambiÃ©n lo hizo la web de noticias. Se adaptaron a los avances tecnolÃ³gicos, implementando caracterÃ­sticas innovadoras como la personalizaciÃ³n de contenido, la integraciÃ³n de redes sociales y la optimizaciÃ³n para dispositivos mÃ³viles. Estas mejoras no solo ampliaron su alcance, sino que tambiÃ©n mejoraron la experiencia del usuario.\r\n<br><br>\r\nSin embargo, el camino no estuvo exento de desafÃ­os. En un entorno en lÃ­nea saturado de informaciÃ³n, la competencia era feroz. La lucha contra la desinformaciÃ³n y la manipulaciÃ³n se convirtiÃ³ en una batalla constante, pero la web de noticias se mantuvo firme en su compromiso con la integridad periodÃ­stica y la veracidad.\r\n<br><br>\r\nCon el tiempo, la web de noticias se consolidÃ³ como una fuente de informaciÃ³n confiable y respetada a nivel mundial. Su historia no solo reflejaba el surgimiento de Internet como un medio de comunicaciÃ³n dominante, sino tambiÃ©n la capacidad del ser humano para adaptarse y aprovechar la tecnologÃ­a en beneficio de la sociedad.<br><br>', NULL);
